const ResultDiv = (props) => {

    const salt = props.salt;
    const mettedeFettsyrer = props.mettedeFettsyrer;
    const sukkerarter = props.sukkerarter;

    return (
        <div>

            <div class="col-md-6">
                <h3>Mulige ernærings- og helsepåstander</h3>
                {{ mettedeFettsyrer } === 2 &&
                    <div className="container food-result-container">
                        <h5>Nøkkelhullet</h5>
                        <p>Produktet innfrir Nøkkelhullet </p>
                    </div>
                }
            </div>
        </div>
    )
};

export default ResultDiv;
